INSERT INTO routes (name, description, gpx_coordinates, level, author_id)
VALUES ('Творчески дом Петрохан - Гара Лакатник',
        'Село Гара Лакатник се намира в Искърското дефиле в Стара планина, на 20 km от Своге и на 50 km. северозападно от София и е популярна дестинация за катерачи и пещерняци поради близостта му до известните Лакатнишки скали, едни от най-красивите сред природните забележителности на България; с идеални условия за скално катерене. На върха на скалите се издига масивен паметник от каменни блокове, построен в памет на загиналите септемврийци през 1923 г. Там всяка година между 10 и 17 май се организира събор. На скалата срещу паметника има висок метален кръст, издигнат да напомня за всички алпинисти и планинари, загинали по скалите. Около с. Гара Лакатник има и много пещери, например Темната дупка, Ръжишка пещера и др. Мястото е изходен център за краткотраен планински туризъм.',
